import React, { useState } from "react";
import AdminDashboard from "./Dashboard/AdminDashboard/AdminDashboard";
import Sidebar from "./Component/Sidebar/Sidebar";
import Cityoperation from "./Pages/Modules/CityOperation/Cityoperation";
import Usermanagement from "./Pages/Modules/Usermanagement/Usermanagement";
import Oilmanagement from "./Pages/Modules/OilManagement/Oilmanagement";
import Fleetmanagement from "./Pages/Modules/Fleetmanagement/Fleetmanagement";

// import Analytics, Settings, Login if needed

const serviceComponents = {
  dashboard: <AdminDashboard/>,
  sidebar: <Sidebar/>,
  fleet: <Fleetmanagement />,
  oil: <Oilmanagement />,
  user: <Usermanagement />,
  city: <Cityoperation />,
  // Add analytics, settings components likewise
};

export default function App() {
  const [activeService, setActiveService] = useState('dashboard');
  return (
    <div className="app-wrapper">
      <Sidebar onSelect={setActiveService} activeKey={activeService} />
      <main style={{ flex: 1 }}>
        {serviceComponents[activeService] ?? <AdminDashboard />}
      </main>
    </div>
  );
}
